import Header from "./Header";
import Footer from "./Footer";
import Body from "./Body";

export class Root extends React.Component{
    render(){
    return (
        <div>
            <Header class="header"/>
            <Body class="body"/>
            <Footer class="footer"/>
        </div>
    ) 
    }
}
